import React from 'react';
import Head from 'next/head';

export default class Index extends React.Component {
    render () {
        return (
            <div>
                <Head>
                    <title>Reece Russell / Software Developer</title>
                </Head>

                <h1>Reece Russell</h1>
                <h4>Software Developer</h4>
            </div>
        )
    }
}
